INSERT INTO `news` VALUES
(1,'First release','Hello in Falling Squares! I am really excited from started this app for you and I hope that the start will be without problems. In future will be more news and features so look them carefully. See you soon!'),
(2,'Accessible fixes','Hello! I\'m really sorry for first problems after share the application to your using. Great thank you for any feedback sent to me and my promoter. In second part of improvements there are some accessibility fixes for mobile devices users like links on login and registration page - due to these pages were confusing. Also there is information that the game is unplayable on mobile devices, so you won\'t be able run a game on mobile device. On Dashboard you have one new statistic card and  some information about your last game. Thanks for your support and playing and have a nice long weekend!');
